CREATE TABLE public.tmp_backbone_matching_2 (
    id integer,
    backbone_id integer
);

--- Fuzzy matching done with GBIF's https://www.gbif.org/tools/species-lookup

-- Match the unmatched
UPDATE taxomap_unmatched SET backbone_id = tmp.backbone_id FROM tmp_backbone_matching_2 tmp WHERE taxomap_unmatched.id = tmp.id;

DROP TABLE tmp_backbone_matching_2;

-- Remove erroneous countrycodes
UPDATE taxomap_unmatched t
SET countrycode = NULL
WHERE countrycode IS NOT NULL
  AND NOT EXISTS (
        SELECT 1
        FROM country c
        WHERE c.code = t.countrycode
  );

-- Copy all data to normalized table
     country_code, state_province, county, municipality,
     georeference_verification_status, identification_verification_status)
SELECT
    id,
    institutioncode_id AS institution_id,
    NULLIF(collectioncode, '') AS collection_code,
    catalognumber AS catalog_number,
    basisofrecord_id AS basis_of_record_id,
    backbone_id AS taxon_id,
    geom AS geometry,
    CASE
        WHEN year IS NULL OR month IS NULL OR day IS NULL THEN NULL
        WHEN month < 1 OR month > 12 THEN NULL
        WHEN day < 1 OR day > 31 THEN NULL
        WHEN month IN (4, 6, 9, 11) AND day > 30 THEN NULL
        WHEN month = 2 AND day > 29 THEN NULL
        WHEN month = 2 AND day = 29 AND (year % 4 != 0 OR (year % 100 = 0 AND year % 400 != 0)) THEN NULL
        ELSE make_date(year, month, day)
    END AS event_date,
    NULLIF(countrycode, '') AS country_code,
    NULLIF(stateprovince, '') AS state_province,
    NULLIF(county, '') AS county,
    NULLIF(municipality, '') AS municipality,
    'UNVERIFIED' AS georeference_verification_status,
    'UNVERIFIED' AS identification_verification_status
FROM
    taxomap_unmatched
ON CONFLICT (institution_id, collection_code, catalog_number) DO NOTHING;

-- Celebrate
DROP TABLE taxomap_unmatched;
